import React from "react";

class Contactinfo extends React.Component {

    constructor() {
        super();
        this.state = {
            address : '',
            email : '',
            contact : ''
        };

        this.changeInput = this.changeInput.bind(this);
        this.submit = this.submit.bind(this);

    }


    changeInput(el) {
        this.setState({
            [el.target.name] : el.target.value
        })
    }

    submit() {

    }

    render() {
        return(

            <div>
                <h3>Create Brand</h3>
                <hr />
                <div >
                    <div className="form-group">
                        <label for="exampleInputEmail1">Address</label>
                        <input type="text" className="form-control" name="address" value={this.state.address} placeholder="Enter brand name" onChange={changeInput} />
                    </div>

                    <div className="form-group">
                        <label for="exampleInputEmail1">Email Id</label>
                        <input type="text" className="form-control" name="email" value={this.state.email} placeholder="Enter brand name" onChange={changeInput} />
                    </div>

                    <div className="form-group">
                        <label for="exampleInputEmail1">Contact Number</label>
                        <input type="text" className="form-control" name="contact" value={this.state.contact} placeholder="Enter brand name" onChange={changeInput} />
                    </div>
                    <button type="submit" onClick={submit} className="btn btn-primary">Submit</button>
                </div>
            </div>
        )

    }
}


export default Contactinfo;
